    "#Normalize (Min-Max) every value in a given dictionary (method 2 & 3)\n",
    "def mmNormalizeDict(dic, elMax, elMin):\n",
    "    #for key, value in dic.items():\n",
    "    #    dic[key] = ((value - elMin) / (elMax - elMin))\n",
    "    #printResults(\"Assigned\", dic.values())\n",
